import React, {Component} from 'react'

import {List,ListItem,ListItemText,Paper} from '@material-ui/core'

import Card from 'react-bootstrap/Card'
import CardDeck from 'react-bootstrap/CardDeck'
import Button from 'react-bootstrap/Button'
import ListGroup from 'react-bootstrap/ListGroup'
import ListGroupItem from 'react-bootstrap/ListGroupItem'

class Cart extends Component {
  createTask = item => {
    return (
      <Paper style={{backgroundColor:"green", justifyContent:"center"}}>
        <ListItemText>{item.name}</ListItemText>
      </Paper>
    )
  }
  render() {
    const items = this.props.items
    const listItems = items.map(this.createTask)
    return (
      <Paper style={{backgroundColor:"pink", justifyContent:"center", display:"flex", marginRight :"50px", marginLeft :"50px", marginTop :"50px", marginBottom :"50px"}}>
        <List>{listItems}</List>
      </Paper>
    )
  }
}

export default Cart
